import Social_inline from "./Social_inline";
import logo from "../assets/Got7_2022_logo.png";

function Contact() {
  return (
    <>
      <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }
        `}
      </style>
      <Social_inline />
      <div className="app">
        <div
          className="head-logo"
          style={{
            display: "flex",
            height: "60px",
            justifyContent: "center",
            position: "relative",
            marginTop: "-50px",
          }}
        >
          <img src={logo}></img>
        </div>
      </div>
      <div className="notice-heading">
        <h1
          style={{
            textAlign: "center",
            marginTop: "60px",
            color: "#3C8350",
            fontSize: "38px",
          }}
        >
          CONTACT
        </h1>
      </div>
      <div className="location_detail" style={{textAlight}}>
        <p>154-11 Samsung-dong Kangnam-ku Seoul, Seoul, Seoul, South Korea</p>
        <p>PHONE NUMBER | +82 2 557 1525 FAX +82 2 563 1085</p>
      </div>
      <div
        className="notice-contianer"
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div
          className="notice"
          style={{
            display: "flex",
            flexDirection: "column",
            backgroundColor: "white",
            marginTop: "60px",
            width: "700px",
            borderRadius: "20px",
          }}
        >
          <div className="notice-con">
            <div className="notice-body-01">
              <div className="notice-head" style={styleHead}>
                <h3 style={h3}>GOT7 - Home Coming Concert</h3>
                <div className="date">
                  <p>2022-05-23</p>
                </div>
              </div>
            </div>
            <hr style={hr}></hr>
            <div className="notice-body-02">
              <div className="notice-head" style={styleHead}>
                <h3 style={h3}>GOT7 - NANANA Official MV Release</h3>
                <div className="date">
                  <p>2022-05-23</p>
                </div>
              </div>
            </div>
            <hr style={hr}></hr>
            <div className="notice-body-03">
              <div className="notice-head" style={styleHead}>
                <h3 style={h3}>Happy Birthday Jay B.</h3>
                <div className="date">
                  <p>2022-01-06</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Contact;

const styleHead = {
  marginLeft: "30px",
  marginTop: "30px",
  marginBottom: "30px",
};

const hr = {
  width: "640px",
};

const h3 = {
  color: "#3C8350",
  marginBottom: "-5px",
};
